import { BsSearch, BsFillCarFrontFill } from "react-icons/bs";
import { AiOutlineShoppingCart, AiFillHeart } from "react-icons/ai";
import {FaBars} from "react-icons/fa";

const icons = {
  BsSearch,
  AiOutlineShoppingCart,
  BsFillCarFrontFill,
  FaBars,
  AiFillHeart
};

export default icons;
